import "./menu-item.styles.scss";
const MenuItem = ({title}) => (
  <div style={{
      backgroundImage: image
  }} className="menu-item">
    <div className="content">
      <h1 className="title">{title}</h1>
      <span className="subtitle">SHOW NOW</span>
    </div>
  </div>
);
export default MenuItem;
